import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Article(props) {
	return <div className="article_thumbnail">
		<img className="article_image" src={props.urlToImage}></img>
			<div className="article_text">
				<h3>{props.article_title}</h3>
				<h3 className="article_category">{props.article_category}</h3>
				<p className="article_subtext">{props.article_subtext}</p>
			</div>
  		</div>;
}

var url = 'https://newsapi.org/v2/top-headlines?' +
          'country=nl&' +
          'apiKey=59c89082598e49e69463d95c1cedf96d';

var req = new Request(url);

fetch(req)
    .then(function(response) {
		response.json().then(
			function(actualJson) {
				var article1Json;
				var article2Json;

				console.log(actualJson);

				article1Json = actualJson['articles'][0];
				article2Json = actualJson['articles'][1];

				ReactDOM.render(
					<Article urlToImage={article1Json['urlToImage']} 
					article_title={article1Json['title']} 
					article_category="Binnenland" 
					article_subtext={article1Json['description']}>
					</Article>,
					document.getElementById('root')
				  );

				  ReactDOM.render(
					<Article urlToImage={article2Json['urlToImage']} 
					article_title={article2Json['title']} 
					article_category="Binnenland" 
					article_subtext={article2Json['description']}>
					</Article>,
					document.getElementById('column1')
				  );
			}
		);
		console.log('dikke tknewies');
    },
);
